import React from 'react';
import '../styles/about.css';
import ServiceList from '../services/ServiceList';
import {Container,Row,Col} from 'reactstrap';
const About = () => {
  return (
    <>
    <section>
    <Container>
    <h2>What we serve</h2>
      <Row>
        <ServiceList/>
      </Row>
    </Container>
  </section>
    </>
  )
}

export default About
